import React, { useState } from 'react';
import { View, Text, Button, StyleSheet } from 'react-native';

const StateAppFunction = () => {
  const [count, setCount] = useState(0);

  return(
    <View>
      <Text>You clicked {count} times</Text>
      <Button>
        onPress = {() => setCount(count + 1)}
        title = "Click me!"
      </Button>
    </View>
  )
}
